        /// </summary>
        decimal? AvgUtilizationPercentage { get; set; }
        /// <summary>The reservation kind.</summary>
        string Kind { get; set; }
        /// <summary>
        /// This is the maximum hourly utilization in the usage time (day or month). E.g. if usage record corresponds to 12/10/2017
        /// and on that for hour 4 and 5, utilization was 100%, this field will return 100% for that day.
        /// </summary>
        decimal? MaxUtilizationPercentage { get; set; }
        /// <summary>
        /// This is the minimum hourly utilization in the usage time (day or month). E.g. if usage record corresponds to 12/10/2017
        /// and on that for hour 4 and 5, utilization was 10%, this field will return 10% for that day
        /// </summary>
        decimal? MinUtilizationPercentage { get; set; }
        /// <summary>The properties of the reservation summary.</summary>
        Microsoft.Azure.PowerShell.Cmdlets.Consumption.Models.Api20211001.IReservationSummaryProperties Property { get; set; }
        /// <summary>This is the purchased quantity for the reservationId.</summary>
        decimal? PurchasedQuantity { get; set; }
        /// <summary>This is the remaining quantity for the reservationId.</summary>
        decimal? RemainingQuantity { get; set; }
        /// <summary>
        /// The reservation ID is the identifier of a reservation within a reservation order. Each reservation is the grouping for
        /// applying the benefit scope and also specifies the number of instances to which the reservation benefit can be applied
        /// to.
        /// </summary>
        string ReservationId { get; set; }
        /// <summary>
        /// The reservation order ID is the identifier for a reservation purchase. Each reservation order ID represents a single purchase
        /// transaction. A reservation order contains reservations. The reservation order specifies the VM size and region for the
        /// reservations.
        /// </summary>
        string ReservationOrderId { get; set; }
        /// <summary>
        /// This is the total hours reserved. E.g. if reservation for 1 instance was made on 1 PM, this will be 11 hours for that
        /// day and 24 hours from subsequent days
        /// </summary>
        decimal? ReservedHour { get; set; }
        /// <summary>
        /// This is the ARM Sku name. It can be used to join with the serviceType field in additional info in usage records.
        /// </summary>
        string SkuName { get; set; }
        /// <summary>This is the total count of instances that are reserved for the reservationId.</summary>
        decimal? TotalReservedQuantity { get; set; }
        /// <summary>
        /// Data corresponding to the utilization record. If the grain of data is monthly, it will be first day of month.
        /// </summary>
        global::System.DateTime? UsageDate { get; set; }
        /// <summary>Total used hours by the reservation</summary>
        decimal? UsedHour { get; set; }
        /// <summary>This is the used quantity for the reservationId.</summary>
        decimal? UsedQuantity { get; set; }
        /// <summary>This is the utilized percentage for the reservation Id.</summary>
        decimal? UtilizedPercentage { get; set; }

    }
